                                        $(win.document.body).find('table').find('th:eq(15),td:eq(15)')
                                            .remove();

                                        // Obtener la fecha
                                        var now = obtenerFechaHora();

                                        // Agregar la fecha en el lado contrario de la paginación
                                        var pageInfo = $(win.document.body).find('div').filter(
                                            function() {
                                                return $(this).text().match(
